import React from "react";
import "../styles/Navbar.css";

function Navbar() {
  return (
    <div className="nav">
      <div className="logo">
        <img src="" alt="" />{" "}
      </div>
      
      <div className="links">
        <ul>
          <li><a src="">Home</a> </li> 
          <li>Box</li>
          <li>About</li>
        </ul>
      </div>
      
      <div className="search">
        <input type="text" placeholder="Search" />
      </div>
    </div>
  );
}

export default Navbar;
